$(function() {
	
	$("nav").append('<a target="_blank" class="nav" href="http://rowrz.com/themes">theme</a>');
	
	$("body").prepend('<a id="install-btn" href="https://tumblr.com/theme/38849" title="Install This Theme" target="_blank" style="opacity: 1;"><span id="install-btn-txt">Install Theme</span></a>');
	
	setTimeout(function() {
		$('#install-btn').animate({top: "3px"});
	}, 1000);

	var nopoEnabled = $('.entry').hasClass('nopo-enabled') && /\S/.test($('#posts').data('nopo-selector')) && window.location.pathname.split('/')[1] != 'tagged';

	var photoSets = 'iframe.photoset';
	
	$.fn.photosetResize = function() {
	    $(this).each(function(){
	        var newSize = $('.posts').width();
	        var newSrc = $(this).attr('src').replace( '500' , newSize);
	        $(this).attr('src', newSrc).width(newSize);
	        var high = $(this).css('height');
	        var calculate = parseInt(high, 10) * newSize / 500;
	        $(this).css('height', calculate);
	    });
	    return this;
	};
    
	if (nopoEnabled) {

		var nopoTag = $.grep($('#posts').data('nopo-selector'), function(n) {
			return (n)
		});

		$.fn.runNopo = function(tagName){
		    $.inArray(tagName, $.grep($(this).data('nopo-tags').split(" "), function(n) {return (n)})) > -1 && $(this).remove();
		    /*var dataNew = $(this).data('nopo-tags');
		    var splitNew = dataNew.split(" ");
		    var cleanedNew = $.grep(splitNew, function(n) {
				return (n)
			});
			if ($.inArray(tagName, cleanedNew) > -1) {
				$(this).remove();
			}*/
		}

		$.fn.noPo = function(tagName) {
			$(this).siblings().each(function() {
			    /*var data = $(this).data('nopo-tags');
			    var splitData = data.split(" ");
			    var cleanedData = $.grep(data, function(n) {
			        return (n)
			    });
			    if ($.inArray(tagName, cleanedData) > -1) {
			        $(this).remove();
			    }*/
			    $(this).runNopo(tagName);
			})
	    }
		
		$(function() {
			$('.nopo-enabled').noPo(nopoTag[0]); 
	    });
    }

	var postsContainer = $('#posts');
	
	$(photoSets).photosetResize();
	
    postsContainer.imagesLoaded(function() {
        postsContainer.masonry({
            itemSelector: '#entry',
            isResizable: true
        })
    });
    
    if (defensiveInfiniteScroll) {
        postsContainer.infinitescroll({
                navSelector: '#page-nav',
                nextSelector: '#page-nav a',
                itemSelector: '#entry',
                loadingImg: '',
                loadingText: '',
                bufferPx: 100,
                extraScrollPx: 200,
                loading: {
                    finishedMsg: ''
                }
            },
            function (n) {
	            $(n).hide();
	            
	            $(n).find(photoSets).photosetResize();
	            
	            $(n).imagesLoaded(function () {
	            
	                $(n).fadeIn();
	                
	                /*$(n).each(function() {
	                    //$(this).noPo('x');
	                    console.log($(this).data('nopo-tags'));
	                    var dataNew = $(this).data('nopo-tags');
	                    var splitNew = dataNew.split(" ");
	                    var cleanedNew = $.grep(splitNew, function(n) {
							return (n)
						});
						$.inArray('x', cleanedNew) > -1 && $(this).remove();
	                });*/
	                
	                nopoEnabled && $(n).each(function() {
	                	$(this).runNopo(nopoTag[0]);
	                });
	                
	                postsContainer.masonry('appended', $(n), true);
	            });
			});
            /*function(n) {
                $(n).find(pSets).photosetResize();
                $(n).hide().imagesLoaded(function() {
	                if(runNopo){
	                	pContainer.noPo(nopoTag[0]);
	                }
                    pContainer.masonry('appended', $(n).show());
                })
            }
        )*/
    }
});
